  [],\n\t\"revision_timestamp\": \"2016-05-25T00:52:40.523709\",\n\t\"name\": \"faa-bulk-weather-telecommunications-gateway\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The FAA Bulk Weather Telecommunications
  Gateway (FBWTG) provides the FAA communications interface to the National Weather
  Service (NWS) Telecommunications Gateway for the acquisition of gridded model weather
  products. The FBWTG is a module of the WARP at the ATCSCC. The FBWTG will facilitate
  the interagency connection between the 4-D Wx Data Cube (NWS) and NNEW WP1 (FAA).The
  weather products are used by the Weather and Radar Processor (WARP), Integrated
  Terminal Weather System (ITWS).  The FBWTG also provides information transfer and
  delivery for airborne weather observations (from the Meteorological Data Collection
  and Reporting System (MDCRS)) used by ITWS.The Aviation Weather Center in Kansas
  City, MO. uses the communications gateway to delivery weather advisories and information
  of hazardous products to the NAS.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
